import React from 'react';
//import './App.css';
import * as tf from '@tensorflow/tfjs';


<script src="https://cdn.jsdelivr.net/npm/@tensorflow/tfjs@2.0.0/dist/tf.min.js"/>

async function runModel(){
  const model = await tf.loadLayersModel('model_js/model.json');
  return runModel;
}

function App(props) {
  return (
    <div>
      <h1> App </h1>
      <input type="text"></input>

      <button onClick={runModel}>Predict</button>
    </div>
  );
}

export default App;
